import Home1 from "./Product/Home1.vue";
import Home2 from "./Product/Home2.vue";
import Home3 from "./Product/Home3.vue";
import Home4 from "./Product/Home4.vue";

const routes = [
  { path: "/home1", component: Home1 },
  { path: "/home2", component: Home2 },
  { path: "/home3", component: Home3 },
  { path: "/home4", component: Home4 },
];

const router = new VueRouter({
  routes,
});

export default router;
